import React from "react";

const DUMMY_EVENTS = [
  { id: "e1", title: "Some event" },

  { id: "e2", title: "Another event" },
];

const EventsPage = () => {
  return (
    <div>
      <h1>Events Page</h1>

      <ul>
        {PRODUCTS.map((prod) => (
          <li key={prod.id}>
            <Link to={`/products/${prod.id}`}>{prod.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EventsPage;
